import {Crud} from "./Crud";

export const Refunds = () => {
    const headers = [
        "ID",
        "Utilisateur",
        "Montant",
        "Date de mouvement"
    ]
    const names = [
        "id",
        "utilisateur",
        "montant",
        "datedemouvement"
    ]
    const rows = [
        [
            "1",
            "Jean Paul",
            "1000",
            "2021-01-01"
        ],
        [
            "2",
            "Jean Claude",
            "2000",
            "2021-05-11"
        ],
        [
            "3",
            "Thierry Henry",
            "3000",
            "2021-06-01"
        ]
    ]
    const textValues =
        {
            ajouter: "Ajouter un rechargement",
            modifier: "Accepter le rechargment",
            supprimer: "Supprimer le rechargment",
            btnCreer: "Créer",
        }
        const acceptRefund = (id) => {
            console.log(id)
        }
        const userDefinedButton = {
            name: "Accepter",
            event: acceptRefund,
            className: "btn btn-success",
            value: "Accepter"
        }
    return (
        <Crud tableTitle={"Liste des demandes de rechargement"} headers={headers} names={names} rows={rows} textValues={textValues} crud={false} page_description={"Acceptation des demandes de recharge"}/>
    )
}
